import React, { useState } from "react";
import Container from "@material-ui/core/Container";
import { useDispatch, useSelector } from "react-redux";
import { RootStore } from "./Store";
import { GetUserInfo, GetUserAge } from "./Action/UserActions";
import { makeStyles } from "@material-ui/core/styles";
import Card from "@material-ui/core/Card";
import CardActionArea from "@material-ui/core/CardActionArea";
import CardContent from "@material-ui/core/CardContent";
import CardMedia from "@material-ui/core/CardMedia";
import Button from "@material-ui/core/Button";
import Typography from "@material-ui/core/Typography";
import Moment from "moment"

const useStyles = makeStyles({
  root: {
    maxWidth: 345,
    marginRight:20
  },
  media: {
    height: 140,
  },
  conatiner :{
    display:"flex"
  }
});

function App() {
  const dispatch = useDispatch();
  const classes = useStyles();
  const [userName1, setUserName1] = useState("");
  const [userName2, setUserName2] = useState("");
  const [userName3, setUserName3] = useState("");
  const userSates = useSelector((state: RootStore) => state.userinfo);
  const userAge = useSelector((state: RootStore) => state.userAge);
  const handleSerchUser = () => dispatch(GetUserInfo(3));
  const handleAge = () => dispatch(GetUserAge(userName1, userName2, userName3));

  const handleAgenames = (index: number, name: string) => {
    switch (index) {
      case 0:
        return setUserName1(name);
      case 1:
        return setUserName2(name);
      case 2:
        return setUserName3(name);
      default:
        return "";
    }
  };

  return (
    <div className="App">
      <React.Fragment>
        <Container maxWidth="lg">
          {console.log(userAge)}
          {userSates.userinfo && (
            <div className={classes.conatiner}>
              {userSates.userinfo.results.map((val, Index) => {
                return (
                  <div>
                    <Card className={classes.root}>
                      <CardActionArea>
                        <CardMedia
                          className={classes.media}
                          image={val.picture.medium}
                          title="Contemplative Reptile"
                        />
                        <CardContent>
                          <Typography gutterBottom variant="h5" component="h2">
                          {val.name.first + val.name.last}
                          </Typography>
                          <Typography
                            variant="body2"
                            color="textSecondary"
                            component="p"
                          >
                            {Moment(val.dob && val.dob.date).format('DD-MMM-YYYY hh:mm a')}
                          </Typography>
                          <Typography
                            variant="body2"
                            color="textSecondary"
                            component="p"
                          >
                            {val.location.city}
                          </Typography>
                          <Typography
                            variant="body2"
                            color="textSecondary"
                            component="p"
                          >
                            {val.gender}
                          </Typography>
                        </CardContent>
                      </CardActionArea>
                    </Card>
                  </div>
                );
              })}
            </div>
          )}
          {/* <Typography>{state}</Typography> */}
          <Button onClick={() => handleSerchUser()}>serch Users</Button>
          <Button onClick={() => handleAge()}>age</Button>
        </Container>
      </React.Fragment>
    </div>
  );
}

export default App;
